import React from "react";
import "../styles/Roadmap.css";

export default function Roadmap() {
  return (
    <section className="roadmap">
      <div className="lurrie-contaier">
        <ul>
          <li></li>
        </ul>
      </div>
      <div className="roadmap-description">Lorem ipsum</div>
    </section>
  );
}
